  def lengthOfLongestSubstring(s: String): Int = {
    var longest = 0
    for ((_, index) <- s.zipWithIndex) {
      val restLength = s.length - index
      if (restLength < longest) return longest

      val tailString = s.takeRight(restLength)
      val u = uniqueString(tailString)
      if (u.length > longest) {
        longest = u.length
      }
    }
    longest
  }

  def uniqueString(s: String): String = {
    val originalLength = s.length
    @scala.annotation.tailrec
    def uniqueCharacters(original: IndexedSeq[Char], combined: Set[Char], cursor: Int): String = {
      if (originalLength == cursor) return s
      val nextChar = original(cursor)
      if (combined.exists(nextChar.equals(_))) combined.mkString
      else uniqueCharacters(original, combined + nextChar, cursor + 1)
    }

    uniqueCharacters(s.toIndexedSeq, Set(), 0)
  }

